const { gql } = require("apollo-server");

export default gql`

  extend type Query {
    User(id: ID!): User
    Users: [User]
  }

  extend type Mutation {
    CreateUser(input: UserInput): User
    UpdateUser(id: ID!, input: UserInput): User
    DeleteUser(id: ID!): Boolean
  }
`;

